                                    cpm = Math.random() * (9 - 0) + 0;
                                    cpm += appnexus_min_cpm;
                                    if(cpm >= appnexus_max_cpm) {
                                        cpm = appnexus_max_cpm;
                                    }

                                    if(zeroBidRequired>0) { cpm=0; }

                                    res = appnexus_per_tag_resp;
                                    uuid = tag.uuid;

                                    // TODO:: sizes fixed, need to handle this
                                    slot_width = tag.sizes[0].width;
                                    slot_height = tag.sizes[0].height;
                                    //console.log("uuid:");
                                    //console.log(uuid);
                                    //console.log("slot_width:");
                                    //console.log(slot_width);
                                    //console.log("slot_height:");
                                    //console.log(slot_height);
                                    res=res.replace('#UUID',uuid);
